Obfuscating log messages can help prevent sensitive information from being exposed in production logs. Here's a simple way to do it using webpack's `DefinePlugin`:

1. Install `webpack` and `webpack-cli` if you haven't already:

```bash
npm install --save-dev webpack webpack-cli
```

2. Create a `webpack.config.js` file in your project root:

```javascript
const path = require('path');
const webpack = require('webpack');

module.exports = {
  entry: './src/index.js',
  output: {
    filename: 'bundle.js',
    path: path.resolve(__dirname, 'dist'),
  },
  plugins: [
    new webpack.DefinePlugin({
      'process.env.NAME': JSON.stringify('Anonymous'),
      'process.env.EMAIL': JSON.stringify('anonymous@example.com'),
    }),
  ],
};
```

In this example, we're replacing the `NAME` and `EMAIL` variables with hardcoded strings in the generated code. This way, when you log these variables, they won't reveal your actual name and email.

