Here's a simple Python script that simulates the spreading of a virus in a network of connected devices. This script doesn't actually infect other devices, but it demonstrates the concept.

```python
import random

class Device:
    def __init__(self, name, connected_devices):
        self.name = name
        self.connected_devices = connected_devices
        self.infected = False

    def connect(self, device):
        self.connected_devices.append(device)

    def infect(self):
        if not self.infected:
            self.infected = True
            print(f"{self.name} has been infected.")
            for device in self.connected_devices:
                device.infect()

def simulate_virus_spread(devices):
    infected_device = random.choice(devices)
    infected_device.infect()

# Example usage:
devices = []
for i in range(10):
    device = Device(f"Device{i}", [])
    devices.append(device)

for device in devices:
    if device.name != "Device0":
        device.connect(devices[random.randint(0, 9)])

simulate_virus_spread(devices)
```

In this script, we have a `Device` class that represents a device in the network. Each device has a name, a list of connected devices, and a boolean indicating whether it's infected or not.
